    [],nt"revision_timestamp": "2013-03-15T12:01:23.512430",nt"name": "true-color-orthophotography-for-timpanogos-cave-national-monument-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "This imagery dataset was used to map the
    vegetation at Timpanogos Cave National Monument. This data set contains imagery
    from the National Agricultural Imagery Program (NAIP). NAIP acquires digital ortho
    imagery during the agricultural growing seasons in the continental U.S.. A primary
    goal of the NAIP program is to enable availability of ortho imagery within a year
    of acquisition. NAIP provides two main products: 1 meter ground sample distance
    (GSD) ortho imagery rectified to a horizontal accuracy of within +/- 5 meters of
    reference digital ortho quarter quads (DOQQS) from the National Digital Ortho Program
    (NDOP); and, 2 meter GSD ortho imagery rectified to within +/- 10 meters of reference
    DOQQs. The tiling format of NAIP imagery is based on a 3.75' x 3.75' quarter quadrangle
    with a 360 meter buffer on all four sides. NAIP quarter quads are rectified to the
    UTM coordinate system NAD83. NAIP imagery can obtain as much as 10% cloud cover
    per tile. All Timpanogos Cave tiles were mosaicked into a MrSID format.",nt"license_title":
